svg.script:
var ps = -1; // pacman state
var px; // pacman x coord
var py; // pacman y coord
var pa; // pacman angle
var gs; // ghost state
var gx; // ghost x coord
var gy; // ghost y coord
var pacman;
var ghost;
var frame = 0;

//document.getElementById("floor1").setAttribute("display", "none");
//document.getElementById("floor3").setAttribute("display", "none");

function place() {
  pacman.setAttribute("transform", "translate("+px+" "+py+") rotate("+pa+" 15 15)");
  ghost.setAttribute("transform", "translate("+gx+" "+gy+")");
}

function move() {
  switch(ps) {
    case 0: // enter
      px -= 1;
      if(px < 400) ps = 1;
      break; // move up
    case 1:
      pa = 270;
      py -= 1;
      if(py < 220) ps = 2;
      break;
    case 2: // move left
      pa = 180;
      px -= 1;
      if(px < 100) {
        ps = 3;
        gs = 1; // awaken ghost
        ghost.removeAttribute("style");
      }
      break;
    case 3: // run away
      pa = 0;
      px += 2;
      if(px > 420) ps = 4;
      break;
    case 4: // run down
      pa = 90;
      py += 2;
      if(py >= 265) ps = 5;
      break;
    case 5: // run out
      pa = 0;
      px += 2;
      if(px > 570) {
        pacman.setAttribute("style", "display: none");
        ps = 6;
      }
      break;
    case 6: // done
      break;
  }

  switch(gs) {
    case 0: // do nothing;
      break;
    case 1: // move up
      gy -= 1.8;
      if(gy < 220) gs = 2;
      break;
    case 2: // chase
      gx += 1.8;
      if(gx > 420) gs = 3;
      break;
    case 3: // chase down
      gy += 1.8;
      if(gy >= 265) gs = 4;
      break;
    case 4: // chase out
      gx += 1.8;
      if(gx > 570) {
        ghost.setAttribute("style", "display: none");
        ps = -1;
      }
      break;
  }

  ++frame;
  if(((frame + 15) % 30) == 0)
    document.getElementById("mouth").setAttribute("transform", "translate(0 16) scale(1 0.2)");
  if((frame % 30) == 0)
    document.getElementById("mouth").removeAttribute("transform");

  place();
  if(ps != -1)
    setTimeout(move, 10);
}

function easter() {
  if(ps != -1) return;
  ps=0; px=560; py=265; pa=180;

  pacman = document.getElementById("pacman");
  pacman.parentNode.removeChild(pacman);
  pacman.removeAttribute("style");
  document.documentElement.appendChild(pacman);

  gs=0; gx=90; gy=260;
  ghost = document.getElementById("ghost");
  ghost.setAttribute("style", "display: none;");
  ghost.parentNode.removeChild(ghost);
  document.documentElement.appendChild(ghost);

  place();
  setTimeout(move, 10);
  frame = 0;
}

var ts = -1;
var tx;
var ty;
var tux;
var iwas;

function place2() {
  tux.setAttribute("transform", "translate("+tx+" "+ty+")");
}

function clear2() {
  tux.setAttribute("display", "none");
  iwas.setAttribute("display", "none");
}

function move2() {
  switch(ts) {
    case 0:
      tx -= 0.5;
      if(tx < 310) {
        iwas.removeAttribute("display");
        ts = -1;
        setTimeout(clear2, 3000);
      }
      break;
  }

  place2();
  if(ts != -1)
    setTimeout(move2, 10);
}

function easter2() {
  if(ts != -1) return;
  ts = 0; tx = 460; ty = 195;
  tux = document.getElementById("tux");
  tux.parentNode.removeChild(tux);
  tux.removeAttribute("display");
  document.documentElement.appendChild(tux);

  iwas = document.getElementById("iwas");
  iwas.parentNode.removeChild(iwas);
  iwas.setAttribute("display", "none");
  iwas.setAttribute("transform", "translate(240 140)");
  document.documentElement.appendChild(iwas);

  place2();
  setTimeout(move2, 10);
}
